
$(document).ready(function() {

	var folio = localStorage.getItem("Folio");
    var publico = localStorage.getItem("Publico_general");
    var motriz = localStorage.getItem("Discapacidad_motriz");
    var intelectual = localStorage.getItem("Discapacidad_intelectual");
    var visual = localStorage.getItem("Discapacidad_visual");
	var dia = localStorage.getItem("Dia");
	var codigo = getCodigo();

	folio = getFolio(5, folio);
	var imgData = getImg();

	var doc = new jsPDF();

	doc.setFontSize(25);
	doc.addImage(imgData, 'JPEG', 15, 10, 180, 100);

	doc.setFontSize(15);
	doc.text(76, 54, "PASE DE ENTRADA");
	doc.setTextColor(255, 0, 0)
	doc.text(160, 54, "No. " + folio);

	doc.setTextColor(0, 0, 0)
	doc.text(65, 70, "PUBLICO GENERAL");
	doc.text(145, 70, publico);
	doc.text(65, 78, "DISCAPACIDAD VISUAL");
	doc.text(145, 78, visual);
	doc.text(65, 84, "DISCAPACIDAD MOTRIZ");
	doc.text(145, 84, motriz);
	doc.text(65, 90, "DISCAPACIDAD INTELECTUAL");
	doc.text(145, 90, intelectual);

	doc.text(123, 100, dia);

	doc.setFontSize(10);
	doc.text(161, 92, codigo.toString());
	
	var string = doc.output('datauristring');

	$('iframe').attr('src', string);

});

function getCodigo(){
	var codigo = Math.random();
	codigo = Math.round(codigo * 1000000000000);
	return codigo;
}

function getFolio(tam, num) {
	if (num.toString().length <= tam){
		return getFolio(tam, "0" + num)
	}else{
		return num;
	}
}

function getImg(){
	var tarjeta = localStorage.getItem("Tarjeta");

	switch(tarjeta) {
	    case "visa":
	    	var imgData = 'data:image/jpeg;base64,';
	        break;
	    case "master":
	        var imgData = 'data:image/jpeg;base64,';
	        break;
	    case "american":
	        	var imgData = 'data:image/jpeg;base64,';
	        break;
	    default:
        	var imgData = 'data:image/jpeg;base64,';
	}

	return imgData;
}
